-- ============================================================
-- 1. PERBAIKAN VIEW EKSEKUTIF
-- Solusi: Menggunakan fungsi DATENAME untuk mendapatkan nama bulan
-- ============================================================
CREATE   VIEW [dbo].[V_Dashboard_Executive] AS
SELECT 
    d.FullDate,
    d.Year,
    -- Kita generate Nama Bulan langsung dari Tanggal
    DATENAME(MONTH, d.FullDate) AS MonthName, 
    u.NamaUnit,
    p.NamaPosition,
    f.JumlahOrang,
    f.GajiPokok
FROM Fact_EmployeeSnapshot f
JOIN Dim_Date d ON f.DateKey = d.DateKey
JOIN Dim_Unit u ON f.UnitKey = u.UnitKey
JOIN Dim_Position p ON f.PositionKey = p.PositionKey;
GO
