-- ============================================================
-- 2. PERBAIKAN VIEW OPERASIONAL
-- Solusi: Menghapus kolom 'JamMasuk' karena tidak ada di Fact Table
-- (Analisis fokus pada Durasi dan Keterlambatan)
-- ============================================================
CREATE   VIEW [dbo].[V_Dashboard_Operational] AS
SELECT 
    d.FullDate,
    e.NamaPegawai,
    u.NamaUnit,
    -- JamMasuk dihapus karena tidak disimpan di DWH
    f.DurasiKerja,
    f.MenitTerlambat,
    f.StatusKehadiran
FROM Fact_Attendance f
JOIN Dim_Date d ON f.DateKey = d.DateKey
JOIN Dim_Employee e ON f.EmployeeKey = e.EmployeeKey
JOIN Dim_Unit u ON f.UnitKey = u.UnitKey;
GO
