-- =============================================
-- PROCEDURE UNTUK GENERATE DIM_DATE
-- =============================================
CREATE   PROCEDURE [dbo].[Populate_Dim_Date]
AS
BEGIN
    SET NOCOUNT ON;

    -- 1. Hapus data lama (kecuali 19000101 jika mau dipertahankan, tapi truncate lebih bersih)
    DELETE FROM Fact_Attendance;         -- Hapus fakta dulu karena FK
    DELETE FROM Fact_Performance;
    DELETE FROM Fact_EmployeeSnapshot;
    DELETE FROM Dim_Date;

    -- 2. Masukkan default unknown
    INSERT INTO Dim_Date (DateKey, FullDate, Year, Month, Quarter, Semester)
    VALUES (19000101, '1900-01-01', 1900, 1, 1, 1);

    -- 3. Looping dari 2020 sampai 2030
    DECLARE @StartDate DATE = '2020-01-01';
    DECLARE @EndDate DATE = '2030-12-31';

    WHILE @StartDate <= @EndDate
    BEGIN
        INSERT INTO Dim_Date (
            DateKey, 
            FullDate, 
            Year, 
            Month, 
            Quarter, 
            Semester
        )
        VALUES (
            CAST(CONVERT(VARCHAR(8), @StartDate, 112) AS INT), -- YYYYMMDD
            @StartDate,
            YEAR(@StartDate),
            MONTH(@StartDate),
            DATEPART(QUARTER, @StartDate),
            CASE WHEN MONTH(@StartDate) <= 6 THEN 1 ELSE 2 END -- Semester
        );

        SET @StartDate = DATEADD(DAY, 1, @StartDate);
    END

    PRINT 'Dim_Date berhasil diisi dari 2020 s.d 2030';
END;
